import Typewriter from "typewriter-effect";

function App() {
  return (
    <div>
      <Typewriter
        options={{
          strings: ["coming soon..."],
          autoStart: true,
          loop: true,
        }}
        onInit={(typewriter) => {
          typewriter.pause(2000).deleteAll().pause(2000).start();
        }}
      />
    </div>
  );
}

export default App;
